	add("practitioner", "{\"term\":\"practitioner\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Formerly {{m|en|practicioner}} for {{m|en|*practicianer}}, from {{m|en|practician}} + {{m|en|-er}} (the suffix unnecessarily added, as in {{m|en|musicianer}}).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who practices a profession or art, especially law or medicine\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/books-and-arts/21604535-real-sir-isaac-newton-was-not-first-king-reason-last Magician’s passage\u003dThe [Isaac] Newton that emerges from the [unpublished] manuscripts is far from the popular image of a rational \u0027\u0027practitioner\u0027\u0027 of cold and pure reason. The architect of modern science was himself not very modern. He was obsessed with alchemy\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"One who does anything customarily or habitually\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A sly or artful person\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"John Whitgif\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"the men of St. John\u0027s were cunning \u0027\u0027practitioners\u0027\u0027, in shaking off their Masters and Heads\", \"priority\":6}]}, \"synonyms\":{}}");

