	add("praecox", "{\"term\":\"praecox\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{m|la|praecoquō}}, from {{m|la|prae-}} + {{m|la|coquō}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"dementia praeco\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Elizabeth Lunbeck, \u0027The Psychiatric Persuasion\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Psychiatrists did not know the etiology of dementia praecox, but their working assumption was that the brains of \u0027\u0027praecox\u0027\u0027 patients exhibited \u0026quot;demonstrable microscopic cortex changes\u0026quot; as well as \u0026quot;gross anatomical anomalies\u0026quot\", \"priority\":3}]}, \"synonyms\":{}}");

