	add("pragmatism", "{\"term\":\"pragmatism\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) stem of \u0027πρᾶγμα\u0027 (act) + {{m|en|-ism}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The pursuit of practicality over aesthetic qualities; a concentration on facts rather than emotions or ideals\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The theory that political problems should be met with practical solutions rather than ideological ones\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The idea that beliefs are identified with the actions of a believer, and the truth of beliefs with success of those actions in securing a believer\u0027s goals; the doctrine that ideas must be looked at in terms of their practical effects and consequences\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1902\u0027\u0027, William James, \u0027The Varieties of Religious Experience\u0027, Folio Society 2008, p. 378\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Our conception of these practical consequences is for us the whole of our conception of the object [...] This is the principle of Peirce, the principle of \u0027\u0027pragmatism\", \"priority\":5}]}, \"synonyms\":{}}");

