	add("prairie", "{\"term\":\"prairie\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|lang\u003den}} \u0027prairie\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An extensive area of relatively flat grassland with few, if any, trees, especially in North America\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"It was not far from the house; but the ground sank into a depression there, and the ridge of it behind shut out everything except just the roof of the tallest hayrick. As one sat on the sward behind the elm, with the back turned on the rick and nothing in front but the tall elms and the oaks in the other hedge, it was quite easy to fancy it the verge of the \u0027\u0027prairie\u0027\u0027 with the backwoods close by\", \"priority\":2}]}, \"synonyms\":{}}");

