	add("prana", "{\"term\":\"prana\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Sanskrit\"], \"text\":\"From Sanskrit \u0027प्राण\u0027 (breath, life)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Respiration, breathing, seen as a life principle or life force\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1919\u0027\u0027, \u0027The Upanishads\u0027 translated by Swami Paramananda\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He it is who sends the (in-coming) \u0027\u0027Prana\u0027\u0027 (life-breath) upward and throws the (out-going) breath downward\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1919\u0027\u0027, \u0027The Upanishads\u0027 translated by Swami Paramananda\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"He who knows Aditi, who rises with \u0027\u0027Prana\u0027\u0027 (the Life Principle), existent in all the Devas\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1919\u0027\u0027, \u0027The Upanishads\u0027 translated by Swami Paramananda\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"May my limbs, speech, \u0027\u0027Prana\u0027\u0027 (life-force), sight, hearing, strength and all my senses, gain in vigor\", \"priority\":7}]}, \"synonyms\":{}}");

	add("prang", "{\"term\":\"prang\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A bombing raid\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An aeroplane crash\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Bill Marsh, \u0027Great South Australia Stories\u0027, HarperCollins Publishers, Australia, %22prangs%22+australia+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dVxzoT8LVF6SPiAfQ-tBa\u0026amp;redir_esc\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"%22prangs%22%20australia%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"I remember when a call came through that a crop sprayer had had a plane \u0027\u0027prang\u0027\u0027 down at Naracoorte, in the south-east of South Australia\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An accident involving a motor vehicle, typically minor and without casualties\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1984\u0027\u0027, Ian Manning, \u0027Beyond walking distance: The Gains from Speed in Australian Urban Travel\u0027, %22prangs%22+australia+-intitle:%22%22+-inauthor:%22%22\u0026amp;dq\u003d%22prang%22|%22prangs%22+australia+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dNiboT8K-OIaciAeetYFZ\u0026amp;redir_esc\u003dy page 105\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The typical \u0027\u0027prang\u0027\u0027 cost a few hundred dollars in panelbeating charges\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Lydia Laube, \u0027Bound for Vietnam\u0027, %22prangs%22+australia+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dVxzoT8LVF6SPiAfQ-tBa\u0026amp;redir_esc\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"%22prangs%22%20australia%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 209\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"If people drove like that in Australia there would be constant \u0027\u0027prangs\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Bridget Griffen-Foley, \u0027Changing Stations: The Story of Australian Commercial Radio\u0027, %22prangs%22+australia+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dVxzoT8LVF6SPiAfQ-tBa\u0026amp;redir_esc\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"%22prangs%22%20australia%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 90\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The drive host, Mark Day, recalls the sinking feeling as he covered an accident on the Tullamarine expressway and wondered what commuters in Sydney would think about hearing all the details of the \u0027\u0027prang\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"crack Crack cocaine\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"A type of tower or spire featured in some Buddhist temples of Thailand and Cambodia\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Joshua Eliot, \u0027Thailand and Burma Handbook 1996\u0027, %22prangs%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;dq\u003d%22prang%22|%22prangs%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dzxHoT4G-KsXZigeMysVZ\u0026amp;redir_esc\u003dy page 216\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027prang\u0027\u0027 is surrounded by walls, which are in turn surrounded by smaller \u0027\u0027prangs\u0027\u0027 and chedis, some of which are rather precariously supported\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Paul Gray, Lucy Ridout, \u0027The Rough Guide to Bangkok\u0027, %22prangs%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dzxHoT4G-KsXZigeMysVZ\u0026amp;redir_esc\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"%22prangs%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 119\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"The second platform surrounds the base of the \u0027\u0027prang\u0027\u0027 proper, whose closed entranceways are guarded by four statues of the Hindu god Indra on his three-headed elephant Erawan\", \"priority\":21}]}, \"synonyms\":{}}");

	add("prank", "{\"term\":\"prank\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"Danish\", \"German\", \"middle dutch (ca. 1050-1350)\", \"English\", \"middle english (1100-1500)\", \"middle low german\", \"Dutch\"], \"text\":\"From Middle english (1100-1500) \u0027pranken\u0027 (to adorn, arrange one\u0027s attire) probably from Middle dutch (ca. 1050-1350) \u0027pronken\u0027 \u0027proncken\u0027 (to flaunt, make a show, arrange one\u0027s attire) Cognate with Middle low german \u0027prunken\u0027 (to flaunt) German \u0027prunken\u0027 (to flaunt) Danish \u0027prunke\u0027 (to make a show, prank) Connected also with German \u0027prangen\u0027 (to make a show, be resplendent) Dutch \u0027prangen\u0027 (to squeeze, press) Danish \u0027pragt\u0027 (pomp, splendor) all from Proto-germanic {{m|gem-pro|*pranganą}}, {{m|gem-pro|*prangijaną}}, {{m|gem-pro|*prag-||to press, squeeze, thring}}, from Proto-indo-european {{m|ine-pro|*brAngh-||to press, squeeze}}. Sense of \u0026quot;mischievous act\u0026quot; from earlier verbal sense of \u0026quot;to be crafty or subtle, set in order, adjust\u0026quot;. See also {{l|en|prink}}, {{l|en|prance}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An evil deed; a malicious trick, an act of cruel deception\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"II.4.2.ii\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Hercules, after all his mad \u0027\u0027pranks\u0027\u0027 upon his wife and children, was perfectly cured by a purge of hellebor, which an Antieyrian administered unto him\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A practical joke or mischievous trick\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"His \u0027\u0027pranks\u0027\u0027 have been too broad to bear with\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Sir Walter Raleig\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The harpies played their accustomed \u0027\u0027pranks\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Pranks\u0027\u0027 may be funny, but remember that some people are aggressive\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"He pulled a gruesome \u0027\u0027prank\u0027\u0027 on his sister\", \"priority\":10}]}, \"synonyms\":{}}");

	add("pranayama", "{\"term\":\"pranayama\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Sanskrit\"], \"text\":\"From Sanskrit \u0027sc\u003ddeva\u0027 from \u0027sc\u003ddeva|प्राण|tr\u003dprāṇá\u0027 (life force, vital energy, the breath) (whence also English \u0027prana\u0027 + \u0027sc\u003ddeva|आयाम|tr\u003dāyāma\u0027 (lengthening, extending, stretching)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Breathing techniques. When used as a technical term in yoga, it is often translated more specifically as \u0026quot;breath control\u0026quot\", \"priority\":1}]}, \"synonyms\":{}}");

	add("prance", "{\"term\":\"prance\", \"etymology\":{\"influencers\":[{},{},{}], \"languages\":[\"bavarian\", \"English\", \"middle english (1100-1500)\", \"swiss german\"], \"text\":\"From Middle english (1100-1500) \u0027prancen\u0027 \u0027prauncen\u0027 (to prance\u0026quot;, \u0027literally,\u0027 \u0026quot;to show off) variant of Middle english (1100-1500) \u0027pranken\u0027 (to prank) Cognate with Bavarian \u0027prangezen\u0027 \u0027prangssen\u0027 (to put on airs) Swiss german \u0027pranzen\u0027 (to strut) More at {{l|en|prank}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of prancing\", \"priority\":1}]}, \"synonyms\":{}}");

	add("prankee", "{\"term\":\"prankee\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|prank|ee|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The victim of a prank\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Tara Calishain, Rael Dornfest, \u0027Google hacks\u0027 (page 271\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"There are three ways to deliver the prank to the \u0027\u0027prankee\u0027\u0027. The first way is in person\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Gregory Hansen, Richard Seaman, \u0027A Florida Fiddler: The Life And Times of Richard Seaman\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Richard admits that he had been the prankster as well as the \u0027\u0027prankee\", \"priority\":5}]}, \"synonyms\":{}}");

	add("prasine", "{\"term\":\"prasine\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"ancient greek (to 1453)\", \"Latin\", \"anglo-norman\"], \"text\":\"From a combination of Anglo-norman \u0027prame\u0027 Middle french (ca. 1400-1600) \u0027prame\u0027 (from \u0027\u0027 and Middle french (ca. 1400-1600) \u0027prasine\u0027 (from \u0027\u0027 , both ultimately from Latin \u0027prasinus\u0027 (leek-green) from Ancient greek (to 1453) \u0027πράσινος\u0027 from \u0027πράσον\u0027 (leek)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A green gem; an emerald\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A type of green pigment\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Pseudomalachite\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1864\u0027\u0027, \u0027Chemical News\u0027, 5 Nov 1864\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"It is possible that just as chrysocolla is silicated malachite, so \u0027\u0027prasine\u0027\u0027 is phosphated malachite; the physical appearance of these minerals strongly confirms this view\", \"priority\":5}]}, \"synonyms\":{}}");

