	add("prattery", "{\"term\":\"prattery\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|prat|ery|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Foolishness or foolish behaviour\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004.\u0027\u0027 March 13, “Ian G Batten” (username), “[http://groups.google.com/group/uk.misc/msg/64ee1fecf4b4e135 Re: haddock]”, in \u0026lt;tt\u0026gt;uk.misc\u0026lt;/tt\u0026gt;, \u0027Usenet\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"If an obviously egomanic twit makes wonderful music, should his \u0027\u0027prattery\u0027\u0027 disqualify him? \u0026lt;!-- this was responding to a use of the word \u0026quot;prat\u0026quot; --\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2004.\u0027\u0027 July 20, Alastair Down, \u0027The Racing Post\u0027 (London, England), article \u0027The Open and Shut Case of the Missing Hub-Caps\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Paying sportsmen obscene sums of money does not necessarily mean they behave badly. Unlike football, there seems to be no correlation between fat cattery and \u0027\u0027prattery\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2008.\u0027\u0027 Jan 26, Simon Barnes, \u0027Tehran Times\u0027, article \u0027Keep Class Out of it. In sport you are either good enough, or you’re not\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Marcus Willis... had been driving the coaches at the Lawn Tennis Association to distraction, and with this latest bit of \u0027\u0027prattery\u0027\u0027 finally pushed his luck too far.\u0026lt;!--Of undetermined context:--\u0026gt\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1821.\u0027\u0027 March, Sarah Spencer Lady Lyttelton. \u0027Correspondence of Sarah Spencer Lady Lyttelton 1787-1870\u0027 (Kessinger Publishing, 2006), page 23\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027Prattery\u0027\u0027 are just come to town\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1871.\u0027\u0027 March 18, Edwin Norris, in \u0027The Correspondence of William Henry Fox Talbot, Glasgow University[http://foxtalbot.dmu.ac.uk/project/project.html\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"We have hunutu muttabbiltu, which must be instruments musical, see hunutu in my p. 291. I derive it from \u0026lt;nowiki\u0026gt;\u0026lt;unknown language\u0026gt;\u0026lt;/nowiki\u0026gt; the viol, or prattery, your nabala\", \"priority\":11}]}, \"synonyms\":{}}");

